Ad. Exploring the Scottish landscapes with @jomalonelondon  So many people are set on finding their “signature” fragrance but I have always seen fragrances as something that captures a feeling and a moment. Do you have a signature fragrance or do you switch up your fragrances? No single fragrance can encapsulate everything for me. The limited edition Highlands Collection was the perfect choice for my summer travels. 

The collection is composed of four beautiful scents but my personal favourite is Wild Achillea. A beautiful fresh and woody fragrance with peppery notes that makes perfect for warm or in my case rainy summer Scottish days. 

@jomalonelondon

